import React from 'react';
import Navbar from '../navbar/Navbar';
import './home.css'

class Home extends React.Component {
	render(){
		return(
			<>
			<div className="wrapper">
			<div className="Nav_class"></div>

			<div className="flex1">
				<div>1</div>
				<div>2</div>
				<div>3</div>
				<div>4</div>
				<div>5</div>
			</div>

			<div className="flex">
				<div>1</div>
				<div>2</div>
				<div>3</div>
				<div>4</div>
				<div>5</div>
			</div>
			<div className="footer_class"></div>
			</div>
			</>
		)
	}
}

export default Home;
